import React, {PureComponent} from 'react';
import PropTypes from 'prop-types';
import Tab from "./Tab"
import PopUp from "./PopUp"

class Main extends PureComponent {
    state = {
        charType: 'tables'
    }

    addATable = () => {
        this.setState({numChildren: ''});
    }

    render() {
        return (
            <div className={"main-container"}>
                <div className={"tabs"}>
                    <Tab />
                </div>
                <div>
                    <button onClick={this.addChildren} className={"button"}>Add Table</button>
                </div>
                <div className={"tables"}>
                    <h1>Child number: {this.state.numChildren}</h1>
                </div>
            </div>
        );
    }
}

Main.propTypes = {};

export default Main;
